import React from "react";
import Card from "./Card";
import styles from "../../style/common/card.module.css";
import Title from "../common/Title";

function CardRow() {
  const data = [
    {
      src: "/toy-images/01.png",
      title: "Haters slogan hoodie- Olive green",
      desc: "₹1,799.00",
    },
    {
      src: "/toy-images/02.png",
      title: "TYPO HOODIE- RED",
      desc: "₹1,799.00",
    },
    {
      src: "/toy-images/03.png",
      title: "SANATANI Hoodie (Black)",
      desc: "₹1,499.00.",
    },
    {
      src: "/toy-images/04.png  ",
      title: "SYSTUMM TYPO- Hoodie (Green)",
      desc: "₹1,799.00",
    },
    {
      src: "/toy-images/05.png",
      title: "“Haters”- Slogan Hoodie (Light Green)",
      desc: "₹1,799.00",
    },
    {
      src: "/toy-images/07.png",
      title: "SHREE RAM – Hoodie",
      desc: "₹1,799.00",
    },
    {
      src: "/toy-images/08.png",
      title: "BAD-MOSS (Grey)",
      desc: "₹1,499.00",
    },
    {
      src: "/toy-images/09.png",
      title: "Chore Haryana Aale – Purple",
      desc: "₹1,799.00",
    },
  ];

  const tshirts = [
    {
      src: "/toy-images/10.png",
      title: "AnjaniPutra TShirt (Black)",
      desc: "₹799.00",
    },
    {
      src: "/toy-images/11.png",
      title: "SYSTUMM T-Shirt (Lilac)",
      desc: "₹799.00",
    },
    {
      src: "/toy-images/12.png",
      title: "DESTROYER T-shirt (Black)",
      desc: "₹799.00",
    },
    {
      src: "//toy-images/13.png",
      title: "Typographic Print Loose Fit T-Shirt",
      desc: "₹799.00",
    },
  ];

  const sweatshirts = [
    {
      src: "/images/Sweat-1.jpeg",
      title: "BAD-MOSS (Grey)",
      desc: "₹1,499.00",
    },
    {
      src: "/images/Sweat-3.jpeg",
      title: "BAD-MOSS (Sea Green)",
      desc: "₹1,799.00",
    },
    {
      src: "/images/Sweat-2.jpeg",
      title: "Chore Haryana Aale – Black",
      desc: "₹1,799.00",
    },
    {
      src: "/images/Sweat-4.jpeg",
      title: "Women Printed Regular Fit Sweatshirt",
      desc: "₹1,499.00",
    },
  ];

  return (
    <div>
      <Title title="Hoodies" />
      <div className={styles.map1}>
        {data.map((value, index) => {
          return (
            <Card
              key={index}
              src={value.src}
              title={value.title}
              desc={value.desc}
            />
          );
        })}
      </div>

      {/* T-Shirts */}

      <Title title="T-Shirts" />
      <div className={styles.map3}>
        {tshirts.map((value, index) => {
          return (
            <Card
              key={index}
              src={value.src}
              title={value.title}
              desc={value.desc}
            />
          );
        })}
      </div>
      {/* Sweatshirts */}

      <Title title="Sweatshirts" />
      <div className={styles.map2}>
        {sweatshirts.map((value, index) => {
          return (
            <Card
              key={index}
              src={value.src}
              title={value.title}
              desc={value.desc}
            />
          );
        })}
      </div>
    </div>
  );
}

export default CardRow;
